# 189 "libraries/AP_HAL/utility/RingBuffer.h"
template <class T>
class ObjectArray {
public:
    ObjectArray(uint16_t _size) {
        size = _size;
        head = count = 0;
        buffer = new T[size];
    }
    ~ObjectArray(void) {
        delete[] buffer;
    }


    uint16_t available(void) const {
        return count;
    }


    uint16_t space(void) const {
        return size - count;
    }


    bool empty(void) const {
        return count == 0;
    }


    bool push(const T &object) {
        if (space() == 0) {
            return false;
        }
        buffer[(head+count)%size] = object;
        count++;
        return true;
    }




    bool pop(void) {
        if (empty()) {
            return false;
        }
        head = (head+1) % size;
        count--;
        return true;
    }


    void clear(void)
    {
        head = count = 0;
    }




    bool pop(T &object) {
        if (empty()) {
            return false;
        }
        object = buffer[head];
        return pop();
    }






    bool push_force(const T &object) {
        if (space() == 0) {
            pop();
        }
        return push(object);
    }




    bool remove(uint16_t n) {
        if (n >= count) {
            return false;
        }
        if (n == count-1) {

            count--;
            return true;
        }
        if (n == 0) {

            return pop();
        }

        for (uint16_t i=n; i<count-1; i++) {
            *(*this)[i] = *(*this)[i+1];
        }
        count--;
        return true;
    }



    T * operator[](uint16_t i) {
        if (i >= count) {
            return nullptr;
        }
        return &buffer[(head+i)%size];
    }

private:
    T *buffer;
    uint16_t size;
    uint16_t count;
    uint16_t head;
};
